var bytes;
var base64 = "";
if (typeof Buffer === 'undefined') {
    bytes = Uint8Array.from(atob(base64), function (c) {
        return c.charCodeAt(0);
    });
} else {
    bytes = Buffer.from(base64, 'base64');
}

Ember.__loader.require('@glimmer/low-level').__resolve__((importObj) => {
  return WebAssembly.instantiate(bytes, importObj);
});
